INSERT INTO `uploaded_component` VALUES ('b305ed69-4326-424e-b94b-1924d4b5727a',_binary '<%@ taglib prefix=\"spring\" uri=\"http://www.springframework.org/tags\" %>\r\n<%@ page language=\"java\" contentType=\"text/html; charset=ISO-8859-1\" pageEncoding=\"ISO-8859-1\" session=\"true\"%>\r\n\r\n<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta charset=\"ISO-8859-1\">\r\n<title>Insert title here</title>\r\n<%@ taglib prefix=\"c\" uri=\"http://java.sun.com/jsp/jstl/core\"%>\r\n</head>\r\n\r\n<body>\r\n\r\n		\r\n		<div class=\"body\" align=\"center\">\r\n			<form method=\"get\" action=\"edit-book\">\r\n				<input id=\"btn\" type=\"submit\" style=\"width:100%;\" value=\"Edit Books\" />\r\n			</form>\r\n		</div>\r\n	\r\n\r\n</body>\r\n</html>','Edit Book Private','Select and Edit book to library jsp','Library Management  System','Edit Book to library',_binary '',_binary '<%@ taglib prefix=\"spring\" uri=\"http://www.springframework.org/tags\"%>\r\n<%@ page language=\"java\" contentType=\"text/html; charset=ISO-8859-1\" pageEncoding=\"ISO-8859-1\" session=\"true\" errorPage=\"error.jsp\"%>\r\n\r\n<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"author\" content=\"Webteam\">\r\n<title>Preview | RCL</title>\r\n<spring:url value=\"/resources/css/index.css\" var=\"indexCss\" />\r\n<%@ taglib prefix=\"c\" uri=\"http://java.sun.com/jsp/jstl/core\"%>\r\n<link href=\"${indexCss}\" rel=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n\r\n<body>\r\n<jsp:include page=\"HeaderComp.jsp\"></jsp:include>\r\n<div id=\"page\">\r\n	<div id=\"content\">\r\n		<div id=\"title\"><h2>${category }</h2>\r\n		<span class=\"welcome\">Welcome,</span></div>\r\n		\r\n		<div class=\"body\" align=\"center\">\r\n			<form method=\"post\" action=\"edit-book\">\r\n				<h3 style=\"margin:10px 0;font-size:24px\">Edit Books</h3>\r\n				<select name=\"bookid\" style=\"padding:8px 10px;width:87.5%;border: 1px solid #999;\" required>\r\n	